css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document url-prefix("http://www.tumblr.com"), url-prefix("https://www.tumblr.com") 
{

.logo .svg-logo
{
display: none !important;
}

H1.logo
{
width: 300px !important;
height: 55px !important;
margin-top: -7px !important;
padding: 4px 0px 0px 4px !important;
}

H1.logo .logo-anchor
{
height: 100% !important;
}

H1.logo > .logo-anchor
{
display: block !important;
background-size: auto !important;
background-image: url('http://media.tumblr.com/89fd6cdae91622f11cc4e82ec4ddb1d8/tumblr_inline_mqkiryFMAK1qz4rgp.png') !important;
background-position: 0px 0px, right !important;
background-repeat: no-repeat !important;
}

}
